import React,{useState} from 'react';
import {GridList,GridListTile,ListSubheader,GridListTileBar,Modal} from '@material-ui/core'

const handleClick = (setOpen) => {
    setOpen()
}

function Body(props) {
    const [open,setOpen] = useState(false);
  return (
      <div>
      <GridList cellHeight={250} cols={4} spacing={8}>
        {props.data.map(val => (
          <GridListTile key={val.id} onClick={() => handleClick(setOpen)}>
            <img src={`https://farm${val.farm}.staticflickr.com/${val.server}/${val.id}_${val.secret}.jpg`} />
          </GridListTile>
        ))}
      </GridList>
      <Modal
        aria-labelledby="simple-modal-title"
        aria-describedby="simple-modal-description"
        open={open}
        onClose={handleClose}
      >
        <div style={modalStyle} className={classes.paper}>
          <h2 id="simple-modal-title">Text in a modal</h2>
          <p id="simple-modal-description">
            Duis mollis, est non commodo luctus, nisi erat porttitor ligula.
          </p>
          <SimpleModal />
        </div>
      </Modal>
  </div>
  );
}

export default Body;
